/*
* Given a string s, find the first non-repeating character in it and return its index. If it does not exist, return -1.
* Example 1:
*
* Input: s = "leetcode"
* Output: 0
*
* Example 2:
* Input: s = "loveleetcode"
* Output: 2
*
* Example 3:
* Input: s = "aabb"
* Output: -1
*
* Constraints:
* 1 <= s.length <= 105
* s consists of only lowercase English letters.
*
*/
package com.leetcode.practice;

import java.util.Arrays;
import java.util.HashMap;
import java.util.LinkedHashMap;
import java.util.Map;

public class FirstNonRepeatingChar {

    public static int firstUniqChar(String s) {
        int index = -1;
        int[] marker = new int[s.length()];
        for(int i = 0; i<s.length();i++){
            char current = s.charAt(i);
            boolean isDuplicate = false;
            for(int j = 0; j<s.length(); j++){
                char next = s.charAt(j);
                if(i!=j && current == next){
                    marker[i] = -1;
                    marker[j] = -1;
                    isDuplicate = true;
                }
            }
            if(!isDuplicate){
                index = i;
                break;
            }
        }
        return index;
    }

    public static int firstUniqChar1(String s){
        int index = -1;
        Map<String, Integer> mapCount = new LinkedHashMap<>();
        Map<String, Integer> mapIndex = new LinkedHashMap<>();
        for(int i = 0; i<s.length();i++){
            if(mapCount.containsKey(Character.toString(s.charAt(i)))){
                mapCount.put(Character.toString(s.charAt(i)), mapCount.get(Character.toString(s.charAt(i))) + 1);
            }else{
                mapCount.put(Character.toString(s.charAt(i)), 1);
                mapIndex.put(Character.toString(s.charAt(i)), i);
            }
        }
        Object[] keyArray = mapCount.keySet().toArray();
        for(int i = 0; i<keyArray.length;i++){
            if(mapCount.get(keyArray[i]) == 1){
                index = mapIndex.get(keyArray[i]);
                break;
            }
        }
        return index;
    }

    public static int firstUniqChar2(String s){
        HashMap<Character, Integer> count = new HashMap<Character, Integer>();
        int n = s.length();
        // build hash map : character and how often it appears
        for (int i = 0; i < n; i++) {
            char c = s.charAt(i);
            count.put(c, count.getOrDefault(c, 0) + 1);
        }

        // find the index
        for (int i = 0; i < n; i++) {
            if (count.get(s.charAt(i)) == 1)
                return i;
        }
        return -1;
    }

    public static void main(String[] args) {
        System.out.println(firstUniqChar("leetcode"));
        System.out.println(firstUniqChar("loveleetcode"));
        System.out.println(firstUniqChar("aabb"));
        System.out.println(firstUniqChar(""));
        System.out.println(firstUniqChar(""));
        System.out.println(firstUniqChar2("leetcode"));
        System.out.println(firstUniqChar2("loveleetcode"));
        System.out.println(firstUniqChar2("aabb"));
        System.out.println(firstUniqChar2(""));
        System.out.println(firstUniqChar2(""));

    }
}
